import Vue from 'vue'
import Vuetify from 'vuetify'
import 'vuetify/dist/vuetify.min.css'
import '@mdi/font/css/materialdesignicons.css'

Vue.use(Vuetify)

export default new Vuetify({
  icons: {
    iconfont: 'mdi'
  },
  theme: {
    themes: {
      light: {
        primary: '#2C3E50',
        secondary: '#34495E',
        accent: '#E74C3C',
        info: '#3498DB',
        success: '#2ECC71',
        warning: '#F1C40F',
        error: '#E74C3C',
        background: '#ECF0F1'
      }
    }
  }
})
